// Ajuste do ajax para melhorar o tratamento de erro
(function () {
	var ajaxOriginal = $.ajax, obterMsg = function (data) {
		if ((typeof data) === "object")
			return data;
		try {
			return JSON.parse(data);
		} catch (e) {
			return { "tipo": "Erro", "tipoCallback": 0, "titulo": "Erro", "mensagem": "Ocorreu um erro ao tentar exibir uma mensagem enviada pelo servidor!", "botao": "Fechar" };
		}
	};
	$.ajax = function (url, settings) {
		var obj = url, urlOriginal = null, novoObj = {};
		if ((typeof obj) == "string") {
			urlOriginal = obj;
			obj = settings;
		}
		if (obj && obj.success) {
			for (var p in obj)
				novoObj[p] = obj[p];
			if (!("error" in novoObj))
				novoObj.error = tratadorJSONException;
			novoObj.success = function (data, textStatus, jqXHR) {
				if (jqXHR.status === 299) {
					var msg = obterMsg(data);
					switch (msg.tipoCallback) {
						case 1:
							if (("success" in obj)) {
								obj.success(msg, textStatus, jqXHR);
								return;
							}
							break;
						case 2:
							if (("error" in obj)) {
								obj.error(jqXHR, "error", jqXHR.statusText);
								return;
							}
							break;
					}
					Mensagem.Alert(msg);
				} else {
					return obj.success(data, textStatus, jqXHR);
				}
			}
			return (urlOriginal ? ajaxOriginal(urlOriginal, novoObj) : ajaxOriginal(novoObj));
		} else {
			if (!obj)
				obj = {};
			for (var p in obj)
				novoObj[p] = obj[p];
			if (!("error" in novoObj))
				novoObj.error = tratadorJSONException;
			novoObj.success = function (data, textStatus, jqXHR) {
				if (jqXHR.status === 299)
					Mensagem.Alert(obterMsg(data));
			}
			return (urlOriginal ? ajaxOriginal(urlOriginal, novoObj) : ajaxOriginal(novoObj));
		}
	};
})();